INSERT INTO `cocktails` VALUES (1,'Rum','흰색','흰색','더 미셔너리(The Missionary) 은/는 화려한 색상과 풍미로 맛있게 즐길 수 있습니다. 또한, 부드럽고 달큼한 맛이 입 안 가득 퍼져 그 향기가 일품입니다. 누구에게나 사랑받는 칵테일로, 연인, 가족과 함께 하는 시간 또는 혼자만의 여유로운 시간을 이 칵테일과 함께 더욱 특별한 순간으로 만들어보세요!',1,'','https://kindredcocktails.com/sites/kindredcocktails.com/files/styles/large/public/pictures/cocktail/the-missionary.jpg?itok=MT7XW_-H','The Missionary','더 미셔너리',0,NULL,NULL),(2,'Rum','노란색','노란색','미션러리스 다운폴 (돈 더 비치콤버)(Missionary\'s Downfall (Don the Beachcomber)) 은/는 화려한 색상과 풍미로 맛있게 즐길 수 있습니다. 또한, 부드럽고 달큼한 맛이 입 안 가득 퍼져 그 향기가 일품입니다. 누구에게나 사랑받는 칵테일로, 연인, 가족과 함께 하는 시간 또는 혼자만의 여유로운 시간을 이 칵테일과 함께 더욱 특별한 순간으로 만들어보세요!',2,'','https://kindredcocktails.com/sites/kindredcocktails.com/files/styles/large/public/pictures/cocktail/_7505176-edit.jpg?itok=E-GYq9iO','Missionary\'s Downfall (Don the Beachcomber)','미션러리스 다운폴 (돈 더 비치콤버)',0,NULL,NULL),(3,'Brandy','분홍색','흰색','모드 프루 르 쥬노(Mode Pour les Jeunes) 은/는 화려한 색상과 풍미로 맛있게 즐길 수 있습니다. 또한, 부드럽고 달큼한 맛이 입 안 가득 퍼져 그 향기가 일품입니다. 누구에게나 사랑받는 칵테일로, 연인, 가족과 함께 하는 시간 또는 혼자만의 여유로운 시간을 이 칵테일과 함께 더욱 특별한 순간으로 만들어보세요!',2,'','https://kindredcocktails.com/sites/kindredcocktails.com/files/styles/large/public/pictures/cocktail/11055854_627105107423087_271633155_n.jpg?itok=gE6b9Jd0','Mode Pour les Jeunes','모드 프루 르 쥬노',0,NULL,NULL),(4,'Liqueur','흰색','노란색','미즈 매자(Mizz Mazza) 은/는 화려한 색상과 풍미로 맛있게 즐길 수 있습니다. 또한, 부드럽고 달큼한 맛이 입 안 가득 퍼져 그 향기가 일품입니다. 누구에게나 사랑받는 칵테일로, 연인, 가족과 함께 하는 시간 또는 혼자만의 여유로운 시간을 이 칵테일과 함께 더욱 특별한 순간으로 만들어보세요!',2,'','https://kindredcocktails.com/sites/kindredcocktails.com/files/styles/large/public/pictures/cocktail/mizz-mazza.jpg?itok=gu14Gs50','Mizz Mazza','미즈 매자',0,NULL,NULL),(5,'Whisky','흰색','흰색','목킹버드, 위시 미 럭(Mockingbird, Wish Me Luck) 은/는 화려한 색상과 풍미로 맛있게 즐길 수 있습니다. 또한, 부드럽고 달큼한 맛이 입 안 가득 퍼져 그 향기가 일품입니다. 누구에게나 사랑받는 칵테일로, 연인, 가족과 함께 하는 시간 또는 혼자만의 여유로운 시간을 이 칵테일과 함께 더욱 특별한 순간으로 만들어보세요!',2,'','https://kindredcocktails.com/sites/kindredcocktails.com/files/styles/large/public/pictures/cocktail/mockingbirdluck6487.jpg?it