m/contrib/stock-images/2022/06/62b48421bee60.jpg','Dubonnet Cocktail No.1','두보네 칵테일 넘버.원',4,NULL,NULL),(1165,'Rum','흰색','흰색','신선하게 익은 바나나와 바나나 리큐어로 색다른 맛을 더한 카차사, 럼, 옥수수 리큐어로 만든 이 칵테일은 바나나의 특별한 맛을 느낄 수 있는 칵테일입니다.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2022/02/61fbc9415ee59.jpg','Bananarama','바나나라마',5,NULL,NULL),(1166,'Rum','노란색','흰색','이 바나나 향의 알코올 칵테일에서는 카차사와 고도의 럼이 주요한 맛을 형성합니다.',2,'닉 앤 노라 글라스','https://cdn.diffords.com/contrib/stock-images/2022/02/61fbe2c37dc52.jpg','Funky Banana','펑키 바나나',4.5,NULL,NULL),(1167,'Rum','갈색','흰색','해당 칵테일은 이름 그대로, 바나나 향의 럼과 숙성된 럼, 베르무트를 섞어 만든 바나나 맛의 럼 맨해튼 칵테일입니다.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2022/03/622b5fa091d08.jpg','Banana Rumhattan','바나나 럼하탄',4.5,NULL,NULL),(1168,'Rum','흰색','흰색','해당 칵테일은 강한 맛과 향을 가진 네이비 럼에 적당한 양의 라임 주스를 섞은 강렬한 맛의 칵테일입니다.',2,'더블 올드 패션드 글라스','https://cdn.diffords.com/contrib/stock-images/2023/02/63fe28dbd0666.jpg','Grog','그로그',5,NULL,NULL),(1169,'Whisky','흰색','흰색','이 칵테일은 위스키, 사케, 코코넛 워터를 조화롭게 섞어 만든 맛있는 칵테일입니다.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2021/07/60ed9f5c5c782.jpg','Coco Geisha','코코 게이셔',5,NULL,NULL),(1170,'Rum','흰색','흰색','해당 칵테일은 코코넛과 럼, 라임 주스를 섞어 만든 맛있는 칵테일입니다. 이 세 가지 재료는 서로 어우러지는 맛이 좋아서, 색다른 맛을 즐길 수 있습니다. 특히 이 칵테일에서는 고도의 발효된 자메이카 럼을 추가하여, 더욱 강렬하고 풍미 있는 맛을 느낄 수 있습니다.',2,'콜린스 글라스','https://cdn.diffords.com/contrib/stock-images/2019/04/5cb87b2fd16f3.jpg','Coconut Rum Punch','코커넌 넘 펀치',4.5,NULL,NULL),(1171,'Tequila','초록색','노란색','2022 년 미국 텍사스 휴스턴의 피난처 칵테일 바에서 제작된 레시피에서 조정되었습니다.',1,'닉 앤 노라 글라스','https://cdn.diffords.com/contrib/stock-images/2023/02/63e6237821571.jpg','Greenhorn','그린혼',4,NULL,NULL),(1172,'Wine','갈색','흰색','이 라벤더 핑크 음료는 당신 (또는 당신의 파트너)이 발렌타인 티플을 위해 원하는 모든 것입니다.',2,'플루트 글라스','https://cdn.diffords.com/contrib/stock-images/2023/02/63e4d2bdf29c6.jpg','Love Heart','러브 하트',4.5,NULL,NULL),(1173,'Gin','흰색','흰색','아로마화 와인과 마라시노의 키스와 함께 진-포워드. 더 섬세한 키스를 위해 진을 45ml 또는 30ml로 다시 자르고 각각 하나 또는 두 개의 대시를 추가하십시오.',2,'닉 앤 노라 글라스','https://cdn.diffords.com/contrib/stock-images/2022/04/62500ec15fb34.jpg','Kiss','키스',4.5,NULL,NULL),(1174,'Gin','흰색','흰색','아름답게 균형 잡힌 과일 및 복잡한 진한 물린을 더할 수있는 충분한 진이 있습니다.',3,'슬링 글라스','https://cdn.diffords.com/contrib/stock-images/2018/11/5bf7e81ba1e91.jpg','Singapore Sling (Dale DeGroff\'s recipe)','싱가폴 슬링 (데일 데그로프스 레시피)',5,NULL,NULL),(1175,'Liqueur','흰색','노란색','흰색 (실제로 화이트 와인 황금)보다 흰색은 신비합니다. 맛에 관해서는, 화이트 와인 산도는 풍부한 엘더 플라워와 영적인 레이싱의 균형을 이룹니다.',2,'올드 패션드 글라스','https://cdn.diffords.com/contrib/stock-images/2022/02/61fbba9d89afc.jpg','The StiG','더 스티그',5,NULL,NULL),(1176,'Gin','흰색','흰색','해당 칵테일은 향긋하면서도 건조한 맛이 특징인 블렌드 칵테일입니다. 현대적인 바텐딩 규칙에 따르면, 이 칵테일은 스털링이 적당합니다. 그러나, 이 칵테일은 흔히 쉐이크드로 만들어져 더욱 맛있게 즐길 수 있습니다.',2,'마티니 글라스','https://cdn.diffords.com/contrib/stock-images/2019/04/5cc823f2bc23a.jpg','Left Bank Martini','레프트 뱅크 마티니',5,NULL,NULL),(1177,'Rum','흰색','흰색','Navy Rum의 Broadside Firepower는 너무 맛있는 Tiki 스타일의 Libation에서 달콤한 파인애플과 코코넛의 균형을 유지합니다.',2,'티키 머그잔 또는 콜린즈 글라스','https://cdn.diffords.com/contrib/stock-images/2020/07/5f102aa2d9db2.jpg','Painkiller','페인킬러',4.5,NULL,NULL),(1178,'Rum','갈색','노란색','펑키 럼은 복숭아, 파인애플, 라임 및 석류 과일과 얽혀 있습니다. 괴물이지만 균형이 맞습니다.',2,'콜린스 글라스','https://cdn.diffords.com/contrib/stock-images/2020/08/5f2d7ad6e02a8.jpg','Rumshack Punch','럼샥 펀치',4.5,NULL,NULL),(1179,'Tequila','흰색','흰색','연기가 자욱한 캐릭터와 따뜻한 온난화가 많은 마가리타입니다.',3,'올드 패션드 글라스','https://cdn.diffords.com/contrib/stock-images/2022/07/62cc3d900a03f.jpg','Atracci?n Ahumado Margarita','아트라씨온 아우마도 마가리타',4.5,NULL,NULL),(1180,'Whisky','갈색','흰색','이 칵테일은 라이 위스키의 강렬하면서도 건조한 맛과 함께, 레몬 주스와 설탕 시럽의 상큼하면서도 부드러운 맛이 느껴집니다. 전체적으로 매우 시원하고 상쾌한 맛이 특징입니다.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2022/07/62d14c856f124.jpg','Scofflaw','스코프로',4.5,NULL,NULL),(1181,'Tequila','흰색','흰색','Genepi와 Celery는 이 마가리타 리프에 약초 및 식물 맛 (트리플 초 대신)을 추가합니다.',2,'올드 패션드 글라스','https://cdn.diffords.com/contrib/stock-images/2020/07/5f1029f6d3fa3.jpg','Herbaceous Border','어베이셔스 보더',4.5,NULL,NULL),(1182,'Tequila','흰색','흰색','이 칵테일은 마르가리타의 상쾌한 맛과 함께