 Finest','브루클린즈 파이니스트',5,NULL,NULL),(1695,'Mezcal','노란색','흰색','Mezcal, Vermouth Amaro 및 Orange Curaoao Combine은 정신을 포장하는 스피퍼입니다.',2,'닉 앤 노라 글라스','https://cdn.diffords.com/contrib/stock-images/2016/8/34/201623f0ef02b08af745ff5cfb329b9f28e4.jpg','Farmer\'s Tan','파머즈 탠',5,NULL,NULL),(1696,'Vodka','흰색','흰색','특히 2.5ml의 Cr?me de Peche 가이 미묘하게 맛을 낸 보드카 기반 칵테일에 영향을 미치는 것은 놀랍습니다. 특히 자몽을 생략하는 경우',2,'닉 앤 노라 글라스','https://cdn.diffords.com/contrib/stock-images/2016/8/28/2016f5fb78ab4281a45a6364832908329869.jpg','Yuliya Martini','율리아 마티니',4.5,NULL,NULL),(1697,'Rum','흰색','흰색','베리 과일의 힌트와 블루 베리 삼인조의 라벤더 핑크 색조가있는 고전적인 다이 키리의 꽃 리프.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2016/8/28/2016e9f51488c54b94a43d54d1e7f338cd98.jpg','Floral Daiquiri','플로럴 다이키리',4.5,NULL,NULL),(1698,'Brandy','흰색','흰색','활기차고 상쾌하며 매우 재미있는 - 우리는 말장난을 좋아합니다.',1,'올드 패션드 글라스','https://cdn.diffords.com/contrib/stock-images/2016/8/57/2016a2619b93ed4016cddc5d20d68e816814.jpg','Apairoteef','아파이로티프',4.5,NULL,NULL),(1699,'Liqueur','흰색','흰색','허브 갤리 아노, 제네피, 초콜릿 리큐어 추가',2,'록스 글라스','https://cdn.diffords.com/contrib/stock-images/2016/8/29/201628bffba7c2e0ff32c1dd5f6f17917452.jpg','Simon Says','사이먼 세즈',5,NULL,NULL),(1700,'Beer','노란색','노란색','Absinthe의 전체 샷을 포장하는 동안 길고 상쾌한 - 아마',2,'콜린스 글라스','https://cdn.diffords.com/contrib/stock-images/2016/7/58/2016b5e66f95215a4ff182e8465d4262a0ba.jpg','Bohemian Mule','보히미안 뮬',4,NULL,NULL),(1701,'Whisky','분홍색','흰색','베네디티틴의 허브 터치를 가진 달콤한 맨하탄.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2016/7/11/2016a932eeccf5cd17aa7b5ba51042fc2515.jpg','Preakness Cocktail','프리크네스 칵테일',4.5,NULL,NULL),(1702,'Mezcal','갈색','노란색','Mezcal은 고전적인 피와 모래에있는이 리프에 희미한 연기가 자욱한 음표를 추가합니다.정신과 오렌지 주스의 비율은 평소와 약간 높아집니다.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2016/7/37/2016aa0643fc22630ca9df556dd8465083ff.jpg','Velasco and Sand','벨라스코 엔드 샌드',5,NULL,NULL),(1703,'Liqueur','흰색','흰색','빵가 많은 genever, 배, 감귤류 및 희미한 풍부한 꿀이있는 부지.',2,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2016/7/54/2016e152af1ef9e16b67ee91e2b413e82c67.jpg','The Savelberg','더 샤벨버그',4.5,NULL,NULL),(1704,'Spirits','갈색','갈색','스테로이드의 에너지 음료 - 동일한 부분 압생트, 커피 리큐어 및 에스프레소로 가장 잘 설명됩니다.그러나 대부분의 카페인이 함유 된 에너지는',1,'쿠프 글라스','https://cdn.diffords.com/contrib/stock-images/2014/4/43/2014a512d1935b256a511ce8c82cb4278c43.jpg','Flying Frenchman (Absinthe Espresso Martini)','플라이잉 프렌치맨 (압생트 에스프레소 마티니)',4.5,NULL,NULL);
